import React from 'react'
class Dashboardcontent extends React.Component{
    constructor(props){
        super()

    }
render(){
    return(
        <div>
            <div className="div1">
                <div className="div1in1">
                    <div className="dc1">

                    </div>
                    <div className="dc2">

                    </div>
                </div>
                <div className="div1in2">
                <div className="dac1">

                </div>
                <div className="dac2">

                </div>

                </div>
            </div>
        
        
        <style>{`
        .div1{
            display:flex;
            flex-direction:column;
            align-items:center;
            background:pink;
            width:100%;
            height:950px;
            justify-content:space-evenly;
        }
        .div1in1{
            display:flex;
            flex-direction:row;
            background:blue;
            width:70%;
            height:48%;
            flex-wrap:wrap;
            justify-content:space-evenly;
            
        }
        .div1in2{
            display:flex;
            flex-direction:row;
            background:brown;
            
            width:70%;
            height:48%;
            justify-content:space-evenly;
            
        }
        .dc1{
            display:flex;
            background:yellow;
            width:48%;
            flex-basis:450px;
            
        }
        .dc2{
            display:flex;
            background:green;
            width:48%;
            flex-basis:48%;
            flex-basis:450px;
            
        }
        .dac1{
            background:yellow;
            width:48%;
            
        }
        .dac2{
            background:green;
            width:48%
            
        }
        @media (max-width: 1500px) {

            .div1{
            display:flex;
            flex-direction:column;
            height:1900px;
            flex-wrap: wrap;
            
            }
            .dc1{

                
            }
        
        `}

        </style>
        
        
        
        </div>
    )


    }



}
export default Dashboardcontent;
